import React from 'react'
import { connect } from 'react-redux'

const Index = ({ test }) => {
  return (
    <div id='home'>
      { test.value }
    </div>
  )
}

const mapStateToProps = state => {
  return {
    home: state
  }
}

export default connect(mapStateToProps)(Index)
